import React from 'react';
import './App.css';
import {BrowserRouter as Router, Routes, Route} from "react-router-dom"
import Header from "./app/components/Header"
import AppBody from "./app/components/AppBody"


function App() {
  return (
    <div className="app">
      <Router>
        <>
          <Header/>
          <AppBody/>
        </>
      </Router>
    </div>
  );
}

export default App;
